            t.transition(AttributeValue_unquoted);
            break;
        case '\'':
            t.transition(AttributeValue_singleQuoted);
            break;
        case nullChar:
            t.error(this);
            t.tagPending.appendAttributeValue(replacementChar);
            t.transition(AttributeValue_unquoted);
            break;
        case eof:
            t.eofError(this);
            break;
        default:
            t.tagPending.appendAttributeValue(c);
            t.transition(AttributeValue_unquoted);
    }
}
